import React from 'react'
import { useParams } from "react-router-dom";


function Bookingscreen({ match }) {
    return (
        <div>
            <h1>Bookingscreen</h1>
            <p>Room id is: ${match.params.roomid} </p>
        </div>
    )
}

export default Bookingscreen
